package ExcelFile;

public class Planing_jour {
	
	private int num_jour;
	
	private String date;
	
	private String nom;
	
	private String heure_Debut;
	
	private String heure_fin;
	
	private String autre;
	
	private Integer nombre_heure;
	
	private String unite;

	public Planing_jour() {
		super();
		// TODO Auto-generated constructor stub
	}

	public int getNum_jour() {
		return num_jour;
	}

	public void setNum_jour(int num_jour) {
		this.num_jour = num_jour;
	}

	public String getDate() {
		return date;
	}

	public void setDate(String date) {
		this.date = date;
	}

	public String getNom() {
		return nom;
	}

	public void setNom(String nom) {
		this.nom = nom;
	}

	public String getHeure_Debut() {
		return heure_Debut;
	}

	public void setHeure_Debut(String heure_Debut) {
		this.heure_Debut = heure_Debut;
	}

	public String getHeure_fin() {
		return heure_fin;
	}

	public void setHeure_fin(String heure_fin) {
		this.heure_fin = heure_fin;
	}

	public String getAutre() {
		return autre;
	}

	public void setAutre(String autre) {
		this.autre = autre;
	}

	public Integer getNombre_heure() {
		return nombre_heure;
	}

	public void setNombre_heure(Integer nombre_heure) {
		this.nombre_heure = nombre_heure;
	}

	public String getUnite() {
		return unite;
	}

	public void setUnite(String unite) {
		this.unite = unite;
	}
	
	
	
	

}
